const UseEffect = () => {
    const [data,setdata]=useState(0) 
       useEffect(()=>{ 
       console.log("hello")
       },[(data+1)])
       useEffect(()=>{ 
        console.log("")
        },[(data-1)])

  return (
    <div>
      <h1>{data}</h1>
      <button onClick={()=>{setdata(data+1)}}>button1</button><br /><br />
      <button onClick={()=>{setdata(data-1)}}>button2</button>
    </div>
  )
}

export default UseEffect
